import './App.css';
import Grid from '@material-ui/core/Grid';
import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';
import Typography from '@material-ui/core/Typography';
import { makeStyles, createMuiTheme, responsiveFontSizes } from '@material-ui/core/styles';
import NumberWidget from './NumberWidget';
import VaccineWidget from './VaccineWidget';
import Box from '@material-ui/core/Box';
import axios from 'axios';
import { useState, useEffect } from 'react';

let theme = createMuiTheme();
theme = responsiveFontSizes(theme);

const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
  },
  title: {
    flexGrow: 1,
    display: 'none',
    [theme.breakpoints.up('xs')]: {
      display: 'block',
    },
  },
}));



function App() {
  const [data, setData] = useState(testData);
  const classes = useStyles(theme);

  useEffect(() => {
    axios.get('data/taiwan')
    .then(response => {
      setData(response.data);
    }).catch(err => console.error(`Error: ${err}`));
  }, []);
  

  return (
    <Box className={classes.root}>
      <AppBar position="static">
          <Toolbar>
            <Typography className={classes.title} variant="h5">COVID-19 Summary for Taiwan</Typography>
          </Toolbar>
        </AppBar>
      <Box m={3}>
        <Grid container spacing={3} justify="flex-start" className={classes.grid}>
          <Grid item xs={12}>
            <VaccineWidget data = {data} theme = {theme}></VaccineWidget>
          </Grid>
          <Grid item sm={12} md={6}>
            <NumberWidget
              title="Cases"
              subtitle="People tested positive"
              data = {data}
              datakey = {'confirmed'}
              display_key = {"date_str"}
              more_better = {false}
              ></NumberWidget>
          </Grid>
          <Grid item sm={12} md={6}>
            <NumberWidget
              title="Deaths"
              subtitle="People died due to COVID-19"
              data = {data}
              datakey = {'deaths'}
              display_key = {"date_str"}
              more_better = {false}
              ></NumberWidget>
          </Grid>
        </Grid>
      </Box>
    </Box>
  );
}

